import React, { useContext } from 'react';
import { RoomContext } from '../Context';

const Featured = () => {
    const [ values, setValues  ]  = useContext(RoomContext) 

    return (
        <div>
        Featured  page
        {values.map(value => (
            <h6> Name = {value.name} Age = {value.age} </h6>

        )) } 
        </div>
    );
};

export default Featured;
